/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import Star from "../images/star.svg";
import AboutIcons from "../components/AboutIcons";
import { Footer } from "../components/Footer";

const mobile = `@media (max-width: 500px)`;

const AboutDiv = styled.div`
  width: 100%;
  height: 100%;
  font-size: 24px;
  color: white;
  margin: 0 auto;
  bottom: 0;
`;

const AboutText = styled.p`
  padding: 30px;
  max-width: 640px;
  letter-spacing: 2px;
  font-family: Kanit-Medium;
  font-size: 20px;
  color: white;
`;

const StarImg = styled.img`
  width: 50px;
  color: "#aeff00";
  padding: 10px;
`;

const AboutIconsContainer = styled.div`
  padding: 30px;
  text-align: center;
`;

const AboutContainer = styled.div`
  display: flex;
  position: fixed;
  top: 120%;
  left: 12%;

  ${mobile} {
    left: 0;
  }
`;

function About() {
  return (
    <AboutDiv className="About">
      <AboutContainer>
        <AboutIconsContainer>
          <AboutIcons />
        </AboutIconsContainer>
        <AboutText></AboutText>
      </AboutContainer>
      <StarImg src={Star} />
      <StarImg src={Star} />
      <StarImg src={Star} />
      <Footer />
    </AboutDiv>
  );
}

export default About;
